class Node {
  int value;
  int left;
  int right;
  Node({required this.value, required this.left, required this.right});
}

class TreeState {
  List<Node> nodes;
  int root;
  TreeState({required this.nodes, required this.root});
}

int new_node(TreeState state, int value) {
  state.nodes = [...state.nodes, Node(value: value, left: -1, right: -1)];
  return state.nodes.length - 1;
}

void insert(TreeState state, int value) {
  if (state.root == -1) {
    state.root = new_node(state, value);
    return;
  }
  int current = state.root;
  List<Node> nodes = state.nodes;
  while (true) {
    Node node = nodes[current];
    if (value < node.value) {
    if (node.left == -1) {
    int idx = new_node(state, value);
    nodes = state.nodes;
    node.left = idx;
    while (nodes.length <= current) { nodes.add(null as dynamic); } nodes[current] = node;
    state.nodes = nodes;
    return;
  };
    current = node.left;
  } else {
    if (value > node.value) {
    if (node.right == -1) {
    int idx = new_node(state, value);
    nodes = state.nodes;
    node.right = idx;
    while (nodes.length <= current) { nodes.add(null as dynamic); } nodes[current] = node;
    state.nodes = nodes;
    return;
  };
    current = node.right;
  } else {
    return;
  };
