}

List<int> inorder(TreeState state, int idx) {
  if (idx == -1) {
    return ([] as List<dynamic>).map((e) => (e is BigInt ? e.toInt() : (e as int))).toList();
  }
  Node node = state.nodes[idx];
  List<int> result = inorder(state, node.left);
  result = [...result, node.value];
  List<int> right_part = inorder(state, node.right);
  int i = 0;
  while (i < right_part.length) {
    result = [...result, right_part[i]];
    i = i + 1;
  }
  return result;
}

List<int> tree_sort(List<int> arr) {
  TreeState state = TreeState(nodes: [], root: -1);
  int i = 0;
  while (i < arr.length) {
    insert(state, arr[i]);
    i = i + 1;
  }
  if (state.root == -1) {
    return ([] as List<dynamic>).map((e) => (e is BigInt ? e.toInt() : (e as int))).toList();
  }
  return inorder(state, state.root);
}

void main() {
  print(_str(tree_sort(<int>[])));
  print(_str(tree_sort([1])));
  print(_str(tree_sort([1, 2])));
  print(_str(tree_sort([5, 2, 7])));
  print(_str(tree_sort([5, -4, 9, 2, 7])));
  print(_str(tree_sort([5, 6, 1, -1, 4, 37, 2, 7])));
